"""
we have two baskets, when we start collecting, we need
the sequence consisting only of two types of numbers that maximize
the length of the sequence
"""
from collections import deque

class Solution:
    def totalFruit(self, trees):
        if not trees:
            return 0
        else:
            currSeqQueue = deque()
            uniqueNumbersInQueueCount = {}
            maxSeqLen = 0
            for i in range(len(trees)):
                if (len(currSeqQueue) == 0):
                    currSeqQueue.append(trees[i])
                    uniqueNumbersInQueueCount[trees[i]] = 1
                elif (len(uniqueNumbersInQueueCount) < 2):
                    currSeqQueue.append(trees[i])
                    if trees[i] not in uniqueNumbersInQueueCount:
                        uniqueNumbersInQueueCount[trees[i]] = 1
                    else:
                        uniqueNumbersInQueueCount[trees[i]] += 1
                elif ( len(uniqueNumbersInQueueCount) == 2 ):
                    if trees[i] not in uniqueNumbersInQueueCount:
                        while( len(uniqueNumbersInQueueCount) == 2):
                            beingEvicted = currSeqQueue.popleft()
                            uniqueNumbersInQueueCount[beingEvicted] -= 1
                            if uniqueNumbersInQueueCount[beingEvicted] == 0:
                                del uniqueNumbersInQueueCount[beingEvicted]
                        currSeqQueue.append(trees[i])
                        uniqueNumbersInQueueCount[trees[i]] = 1
                    else:
                        currSeqQueue.append(trees[i])
                        uniqueNumbersInQueueCount[trees[i]] += 1
                maxSeqLen = max(maxSeqLen, len(currSeqQueue))
            return maxSeqLen

    def totalFruit1(self, tree):
        if not tree:
            return 0
        else:
            maxSeqLength = 1
            _i = 0

            for i in range(1, len(tree)):
                if tree[i] not in tree[_i:i]:
                    numberOfUniqueKeys = len(self.memoCount(tree[_i:i + 1]))
                    if numberOfUniqueKeys == 0:
                        _i = i

                    elif numberOfUniqueKeys == 1:
                        continue
                    else:
                        while numberOfUniqueKeys > 2:
                            _i += 1
                            numberOfUniqueKeys = len(self.memoCount(tree[_i:i + 1]))
                if maxSeqLength < len(tree[_i:i + 1]):
                    maxSeqLength = len(tree[_i:i + 1])
            return maxSeqLength


